import './App.css';
import reactlogo from './logo192.png';
function App() {
  return (
    <>
      <div class="cards">
        <div className='card'>
          <img src={reactlogo}/>
          <p>Text</p>
        </div>
      </div>
    </>
  );
}

export default App;
